window.bookSummaryJSON = "<p><b>In the second installment of the Immortal Crown Saga, Camille and Xander race against time to uncover the truth behind the Quiet King's ultimate plan.</b></p> <p>Danger lurks around every corner. Nothing is as it seems. The stakes are higher than ever before.</p> <p>Amidst the chaos and uncertainty, Camille and Xander find solace in each other's arms as they delve deeper into a world of intrigue, deception, and dark magic.</p> <p>Can they uncover the truth to save themselves and their world, or will they fall prey to others' deadly schemes?</p>"; 
